import React from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';

function Services() {
  const services = [
    {
      id: 1,
      title: 'Web Design',
      description: 'We specialize in creating beautiful, functional websites that showcase your brand and engage your audience.',
      imageUrl: 'data:image/jpeg;base64,'
    },
    {
      id: 2,
      title: 'Web Development',
      description: 'Our experienced developers can turn your website design into a fully-functional, responsive website that meets your needs.',
      imageUrl: 'data:image/jpeg;base64,'
    },
    {
      id: 3,
      title: 'Digital Marketing',
      description: 'We can help you reach your target audience and grow your business through effective digital marketing strategies.',
      imageUrl: 'data:image/jpeg;base64,'
    }
  ];

  return (
    <Container className="my-5">
      <h2 className="text-center mb-4">Our Services</h2>
      <Row>
        {services.map(service => (
          <Col md={4} key={service.id}>
            <Card className="mb-4">
              <Card.Img variant="top" src={service.imageUrl} alt={service.title} />
              <Card.Body>
                <Card.Title>{service.title}</Card.Title>
                <Card.Text>{service.description}</Card.Text>
                <Button variant="primary">Learn More</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
}

export default Services;
